Наше Учреждение оказывает населению пгт.Магдагачи и Магдагачинского района социальные услуги в полустационарной и надомной формах социального обслуживания. В Учреждении функционируют 5 отделений:
- отделение социального обслуживания на дому;
- отделение срочного социального обслуживания;
- отделение социальной помощи семье и детям;
- отделение по подготовке и сопровождению замещающих семей;
- отделение реабилитации несовершеннолетних с ограниченными физическими и умственными возможностями.

Девизом нашей работы стали слова: "ПОМОЩЬ - НАШЕ ПРИЗВАНИЕ!"

Предмет деятельности учреждения - оказание на территории г. Свободный, Свободненского района и ЗАТО Циолковский семьям и отдельным гражданам, попавшим в трудную жизненную ситуацию, помощи в реализации законных прав и интересов, содействия в улучшении их социального и материального положения, а также их психологического статуса:
- решение общих вопросов социальной поддержки;
- социальная поддержка семьи, женщин и детей;
- социальная поддержка граждан пожилого возраста и инвалидов;
- срочные социальные услуги.
Социальные услуги предоставляются гражданам, признанным нуждающимися в получении социальных услуг. Социальные услуги оказываются форме социального обслуживания на дому, в полустационарной форме, без проживания в отделениях учреждения.

